def add(s1,s2,price):
	p.sendlineafter('>','a')
	p.send(s1.ljust(31,'\x00'))
	p.send(s2.ljust(255,'\x00'))
	p.recv()
	p.sendline(price)
def initentershopname(name):
	p.sendafter("Enter your shop name:",name.ljust(0x12f,'\x00'))
def entershopname(name):
	p.sendlineafter('>','n')
	p.sendlineafter("Enter your shop name:",name)
def show():
	p.sendlineafter('>','l')
def count(haystack):
	p.sendlineafter('>','c')
	p.sendline(haystack)
